package com.higgs.trust.slave.dao.po.pack;import com.higgs.trust.slave.dao.po.BaseEntity;import java.util.Date;public class PendingTransactionPO extends BaseEntity<PendingTransactionPO> {    private static final long serialVersionUID = 1L;    /**     * transaction id     */    private String txId;    /**     * transaction data     */    private String txData;    /**     * transaction handle status     */    private String status;    /**     * block height     */    private Long height;    /**     * create time     */    private Date createTime;    /**     * update time     */    private Date updateTime;    public String getTxId() {        return this.txId;    }    public void setTxId(String txId) {        this.txId = txId;    }    public String getTxData() {        return this.txData;    }    public void setTxData(String txData) {        this.txData = txData;    }    public String getStatus() {        return this.status;    }    public void setStatus(String status) {        this.status = status;    }    public Long getHeight() {        return this.height;    }    public void setHeight(Long height) {        this.height = height;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return this.updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    @Override public String toString() {        StringBuilder builder = new StringBuilder();        builder.append("PendingTransactionPO [");        builder.append("txId=");        builder.append(txId);        builder.append(", txData=");        builder.append(txData);        builder.append(", status=");        builder.append(status);        builder.append(", height=");        builder.append(height);        builder.append(", createTime=");        builder.append(createTime);        builder.append(", updateTime=");        builder.append(updateTime);        builder.append("]");        return builder.toString();    }}